import PumpkinImage from './pumpkin-image.png';

const Pumpkin = {
  name: 'pumpkin',
  target: 'enemy',
  size: { width: 40, height: 40, total: 560 },
  sprite: PumpkinImage,
  information: 'threw a',
};

export default Pumpkin;
